import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from 'react-router-dom';

// import {useRoutes } from 'react-router-dom';

import MasterLayout from './layouts/admin/MasterLayout';  
import Dashboard from './components/admin/Dashboard';
import Products from './components/admin/Products';
import Customers from './components/admin/Customers';
import Users from './components/admin/Users';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>

          {/* <Route path="/admin" name="Admin" render={(props) => <MasterLayout {...props} />} /> */}


          {/* <Route path="/admin" name="Admin" render={(props) => <MasterLayout { ...props } />} /> */}
          {/* <Route path="/admin" element={<MasterLayout />} /> */}

          <Route path="/admin" name="Admin" element={<MasterLayout />} />

          <Route path="/admin/dashboard" element={<Dashboard />} />
          <Route path="/admin/product-management"  element={<Products />} />
          <Route path="/admin/customer-management" element={<Customers />} />
          <Route path="/admin/user-management" element={<Users />} />

        </Routes>
      </Router>
    </div>
  );
}

export default App;


